    var test = myDiagram.model.toJson();
    obj = JSON.parse(test);

    
    function trajetsCalc(){
      var traj = [];
       for (var i = 0; i < obj.linkDataArray.length; i++){
            var testTraj = obj.linkDataArray[i].text;
            if (traj.indexOf(testTraj) === -1) {
              traj.push(testTraj);
            }
        }
        return traj;
    }
    var premier = 'Initial';
    var alphabet = trajetsCalc();
    var arrayListe = [premier];
    var arrayVar = [];
